import { FormObj, fromObjInit } from './account.types';

interface Action {
    type: string;
    payload: FormObj;
}

const defaultState = {
    account: fromObjInit
};

export const AccountReducer = (state = defaultState, action: Action) => {
    switch (action.type) {
        case 'SAVE_CHANGES':
            return { ...state, movieList: action.payload };
        case 'GET_MOVIE_LIST':
            return { ...state, movieList: action.payload };
        default:
            return state;
    }
};
